Описание:
Продаётся земельный участок в жилом массиве г.Нижневартовск. В собственности! Высокий транспортный поток. Участок расположен на первой линии!


Отличная возможность реализовать любой вид деятельности от торговли до сервисных услуг (Строительство торгового центра, автосервиса, складского помещения и офисов).


- Площадь участка: 0,91 Га (кадастровые номера: 86:11:0402001:807; 86:11:0402001:2004);

- На участке построены 2 капитальных гаража;

- Удобные подъездные пути;

- Центральные коммуникации: подведено электричество и газ;

- Полностью отсыпанная песком территория, подготовленная к строительству, часть территории отсыпана щебнем;

- На территории имеется 40 машин щебня, а также сваи 6м в количестве 80шт;

- Имеются несколько вариантов проектов строительства;

- Территория по периметру огорожена новым забором;

- Ограничения прав и обременение на объект недвижимости отсутствуют;

- Быстрый выход на сделку.


Более подробная информация по телефону и при личной встрече., 20 фото
